(48, 'C7ECD7455B7D46E89CF07EB8C0A2337A', 'Math', 'English', 'Determine whether a group of objects (up to 20) has an odd or even number of members, e.g., by pairing objects or counting them by 2s; write an equation to express an even number as a sum of two equal addends.', 3, 'a:1:{i:0;s:2:"02";}', 'Common Core State Standards Initiative', 'CC', 'Grade 2', 'Math.2.OA.3', '2.OA.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143455";s:2:"id";s:8:"S1143455";s:6:"parent";s:8:"S114344F";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"2.OA.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C7ECD7455B7D46E89CF07EB8C0A2337A";s:11:"dotNotation";s:11:"Math.2.OA.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/2/OA/3";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-2/operations-and-algebraic-thinking/#2-oa-3";}'),
(49, 'A4531EC480FA4835AF9E3F9348FC5EC1', 'Math', 'English', 'Use addition to find the total number of objects arranged in rectangular arrays with up to 5 rows and up to 5 columns; write an equation to express the total as a sum of equal addends.', 4, 'a:1:{i:0;s:2:"02";}', 'Common Core State Standards Initiative', 'CC', 'Grade 2', 'Math.2.OA.4', '2.OA.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143456";s:2:"id";s:8:"S1143456";s:6:"parent";s:8:"S114344F";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"2.OA.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"A4531EC480FA4835AF9E3F9348FC5EC1";s:11:"dotNotation";s:11:"Math.2.OA.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/2/OA/4";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-2/operations-and-algebraic-thinking/#2-oa-4";}'),
