(52, 'D9008C43187E44DDA9B676FFEAA78311', 'Math', 'English', 'Interpret whole-number quotients of whole numbers, e.g., interpret 56 Ã· 8 as the number of objects in each share when 56 objects are partitioned equally into 8 shares, or as a number of shares when 56 objects are partitioned into equal shares of 8 objects each.', 2, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.2', '3.OA.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143478";s:2:"id";s:8:"S1143478";s:6:"parent";s:8:"S114346D";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"D9008C43187E44DDA9B676FFEAA78311";s:11:"dotNotation";s:11:"Math.3.OA.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/2";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-2";}'),
