(61, '3D384CB2349B41299A3B5A133AB9E3F9', 'Math', 'English', 'Solve two-step word problems using the four operations. Represent these problems using equations with a letter standing for the unknown quantity. Assess the reasonableness of answers using mental computation and estimation strategies including rounding.', 8, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.8', '3.OA.8', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347E";s:2:"id";s:8:"S114347E";s:6:"parent";s:8:"S1143470";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.8";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3D384CB2349B41299A3B5A133AB9E3F9";s:11:"dotNotation";s:11:"Math.3.OA.8";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/8";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-8";}'),
(62, 'C220B1257A75437196AEBEC0B0C4B4BC', 'Math', 'English', 'Identify arithmetic patterns (including patterns in the addition table or multiplication table), and explain them using properties of operations.', 9, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.9', '3.OA.9', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347F";s:2:"id";s:8:"S114347F";s:6:"parent";s:8:"S1143470";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.9";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C220B1257A75437196AEBEC0B0C4B4BC";s:11:"dotNotation";s:11:"Math.3.OA.9";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/9";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-9";}'),
