(64, '7828B4F15ABD40E19EF14DDE0EB399DF', 'Math', 'English', 'Interpret a multiplication equation as a comparison, e.g., interpret 35 = 5 Ã— 7 as a statement that 35 is 5 times as many as 7 and 7 times as many as 5. Represent verbal statements of multiplicative comparisons as multiplication equations.', 1, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.1', '4.OA.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349A";s:2:"id";s:8:"S114349A";s:6:"parent";s:8:"S1143490";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"7828B4F15ABD40E19EF14DDE0EB399DF";s:11:"dotNotation";s:11:"Math.4.OA.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/1";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-1";}'),
(65, '062925BDC19347E8890A6D7390DF3842', 'Math', 'English', 'Multiply or divide to solve word problems involving multiplicative comparison, e.g., by using drawings and equations with a symbol for the unknown number to represent the problem, distinguishing multiplicative comparison from additive comparison.', 2, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.2', '4.OA.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349B";s:2:"id";s:8:"S114349B";s:6:"parent";s:8:"S1143490";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"062925BDC19347E8890A6D7390DF3842";s:11:"dotNotation";s:11:"Math.4.OA.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/2";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-2";}'),
