(169, 'F82EDE7D54704B7F97AB74D10A56D228', 'Math', 'English', 'A square with side length 1 unit, called &quot;a unit square,&quot; is said to have &quot;one square unit&quot; of area, and can be used to measure area.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.5a', '3.MD.5a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369A";s:2:"id";s:8:"S114369A";s:6:"parent";s:8:"S114348A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.5.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F82EDE7D54704B7F97AB74D10A56D228";s:11:"dotNotation";s:12:"Math.3.MD.5a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/5/a";s:10:"currentURL";N;}'),
