(199, '6B05F71ECDDA44CB9148AC09EB30CE9C', 'Math', 'English', 'Recognize volume as additive. Find volumes of solid figures composed of two non-overlapping right rectangular prisms by adding the volumes of the non-overlapping parts, applying this technique to solve real world problems.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.5c', '5.MD.5c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A4";s:2:"id";s:8:"S11436A4";s:6:"parent";s:8:"S1143500";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.5.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"6B05F71ECDDA44CB9148AC09EB30CE9C";s:11:"dotNotation";s:12:"Math.5.MD.5c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/5/c";s:10:"currentURL";N;}'),
