(201, 'B1AC98EADE4145689E70EEEBD9B8CC18', 'Math', 'English', 'Identify and describe shapes (squares, circles, triangles, rectangles, hexagons, cubes, cones, cylinders, and spheres).', 0, 'a:1:{i:0;s:2:"KG";}', 'Common Core State Standards Initiative', 'CC', 'Kindergart', 'Math.K.G.A', 'K.G.A', 'N;', 'a:4:{s:4:"GUID";s:32:"B1AC98EADE4145689E70EEEBD9B8CC18";s:11:"dotNotation";s:10:"Math.K.G.A";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/k/G/A";s:10:"currentURL";N;}'),
(202, 'D55BE0EDAFBC47B0BBDB1B88F9DF8781', 'Math', 'English', 'Describe objects in the environment using names of shapes, and describe the relative positions of these objects using terms such as above, below, beside, in front of, behind, and next to.', 1, 'a:1:{i:0;s:2:"KG";}', 'Common Core State Standards Initiative', 'CC', 'Kindergart', 'Math.K.G.1', 'K.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143427";s:2:"id";s:8:"S1143427";s:6:"parent";s:8:"S1143415";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"K.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"D55BE0EDAFBC47B0BBDB1B88F9DF8781";s:11:"dotNotation";s:10:"Math.K.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/k/G/1";s:10:"currentURL";s:83:"http://www.corestandards.org/the-standards/mathematics/kindergarten/geometry/#k-g-1";}'),
(203, '4F0A52E0906841DFA13739BFC87B330B', 'Math', 'English', 'Correctly name shapes regardless of their orientations or overall size.', 2, 'a:1:{i:0;s:2:"KG";}', 'Common Core State Standards Initiative', 'CC', 'Kindergart', 'Math.K.G.2', 'K.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143428";s:2:"id";s:8:"S1143428";s:6:"parent";s:8:"S1143415";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"K.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"4F0A52E0906841DFA13739BFC87B330B";s:11:"dotNotation";s:10:"Math.K.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/k/G/2";s:10:"currentURL";s:83:"http://www.corestandards.org/the-standards/mathematics/kindergarten/geometry/#k-g-2";}'),
(204, '01938BB1EE4E47319738DAC239A2B141', 'Math', 'English', 'Identify shapes as two-dimensional (lying in a plane, &quot;flat&quot;) or three-dimensional (&quot;solid&quot;).', 3, 'a:1:{i:0;s:2:"KG";}', 'Common Core State Standards Initiative', 'CC', 'Kindergart', 'Math.K.G.3', 'K.G.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143429";s:2:"id";s:8:"S1143429";s:6:"parent";s:8:"S1143415";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"K.G.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"01938BB1EE4E47319738DAC239A2B141";s:11:"dotNotation";s:10:"Math.K.G.3";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/k/G/3";s:10:"currentURL";s:83:"http://www.corestandards.org/the-standards/mathematics/kindergarten/geometry/#k-g-3";}'),
(205, '5F9DA7B7BFD04F33B5A925A4825B1DB1', 'Math', 'English', 'Analyze, compare, create, and compose shapes.', 0, 'a:1:{i:0;s:2:"KG";}', 'Common Core State Standards Initiative', 'CC', 'Kindergart', 'Math.K.G.B', 'K.G.B', 'N;', 'a:4:{s:4:"GUID";s:32:"5F9DA7B7BFD04F33B5A925A4825B1DB1";s:11:"dotNotation";s:10:"Math.K.G.B";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/k/G/B";s:10:"currentURL";N;}'),
