(261, 'EFC133CD8D34442CA35311157F372C97', 'Math', 'English', 'Understand a fraction 1/b as the quantity formed by 1 part when a whole is partitioned into b equal parts; understand a fraction a/b as the quantity formed by a parts of size 1/b.', 1, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.1', '3.NF.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143483";s:2:"id";s:8:"S1143483";s:6:"parent";s:8:"S1143473";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.NF.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"EFC133CD8D34442CA35311157F372C97";s:11:"dotNotation";s:11:"Math.3.NF.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/NF/1";s:10:"currentURL";s:102:"http://www.corestandards.org/the-standards/mathematics/grade-3/number-and-operations-fractions/#3-nf-1";}'),
