(407, '3DCB5D6E72154F9FAD1A4EEADB8AC125', 'Math', 'English', 'Understand that statistics can be used to gain information about a population by examining a sample of the population; generalizations about a population from a sample are valid only if the sample is representative of that population. Understand that random sampling tends to produce representative samples and support valid inferences.', 1, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.1', '7.SP.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114351E";s:2:"id";s:8:"S114351E";s:6:"parent";s:8:"S114350B";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3DCB5D6E72154F9FAD1A4EEADB8AC125";s:11:"dotNotation";s:11:"Math.7.SP.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/1";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-1";}'),
(408, '1E9C8DCF5D8B444AB189EFE40E899EAB', 'Math', 'English', 'Use data from a random sample to draw inferences about a population with an unknown characteristic of interest. Generate multiple samples (or simulated samples) of the same size to gauge the variation in estimates or predictions.', 2, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.2', '7.SP.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114351F";s:2:"id";s:8:"S114351F";s:6:"parent";s:8:"S114350B";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"1E9C8DCF5D8B444AB189EFE40E899EAB";s:11:"dotNotation";s:11:"Math.7.SP.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/2";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-2";}'),
