(413, '094D610A5BA44E7DAB9D19B61690628B', 'Math', 'English', 'Understand that the probability of a chance event is a number between 0 and 1 that expresses the likelihood of the event occurring. Larger numbers indicate greater likelihood. A probability near 0 indicates an unlikely event, a probability around 1/2 indicates an event that is neither unlikely nor likely, and a probability near 1 indicates a likely event.', 5, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.5', '7.SP.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143522";s:2:"id";s:8:"S1143522";s:6:"parent";s:8:"S114350D";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.5";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"094D610A5BA44E7DAB9D19B61690628B";s:11:"dotNotation";s:11:"Math.7.SP.5";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/5";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-5";}'),
(414, 'F32180F51D5D445EAD4B6F394F3A67EB', 'Math', 'English', 'Approximate the probability of a chance event by collecting data on the chance process that produces it and observing its long-run relative frequency, and predict the approximate relative frequency given the probability.', 6, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.6', '7.SP.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143523";s:2:"id";s:8:"S1143523";s:6:"parent";s:8:"S114350D";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F32180F51D5D445EAD4B6F394F3A67EB";s:11:"dotNotation";s:11:"Math.7.SP.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/6";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-6";}'),
(415, '472222394A204D26844BA834703EAC55', 'Math', 'English', 'Develop a probability model and use it to find probabilities of events. Compare probabilities from a model to observed frequencies; if the agreement is not good, explain possible sources of the discrepancy.', 7, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.7', '7.SP.7', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143524";s:2:"id";s:8:"S1143524";s:6:"parent";s:8:"S114350D";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.7";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"472222394A204D26844BA834703EAC55";s:11:"dotNotation";s:11:"Math.7.SP.7";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/7";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-7";}'),
