(426, '14169C01CC7844AFB61AE4FE479508A2', 'Math', 'English', 'Understand that patterns of association can also be seen in bivariate categorical data by displaying frequencies and relative frequencies in a two-way table. Construct and interpret a two-way table summarizing data on two categorical variables collected from the same subjects. Use relative frequencies calculated for rows or columns to describe possible association between the two variables.', 4, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.SP.4', '8.SP.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114354C";s:2:"id";s:8:"S114354C";s:6:"parent";s:8:"S1143548";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.SP.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"14169C01CC7844AFB61AE4FE479508A2";s:11:"dotNotation";s:11:"Math.8.SP.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/SP/4";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-8/statistics-and-probability/#8-sp-4";}'),
