(467, 'E71EAB46BC9E474C861A53C60CAB9D2C', 'Math', 'English', 'Add vectors end-to-end, component-wise, and by the parallelogram rule. Understand that the magnitude of a sum of two vectors is typically not the sum of the magnitudes.', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSN-VM.4a', 'N-VM.4a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143658";s:2:"id";s:8:"S1143658";s:6:"parent";s:8:"S1143621";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"N-VM.4.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E71EAB46BC9E474C861A53C60CAB9D2C";s:11:"dotNotation";s:14:"Math.HSN-VM.4a";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSN/VM/4/a";s:10:"currentURL";N;}'),
