(469, 'B5969B9BA727452CAB1EF05C4694974C', 'Math', 'English', 'Understand vector subtraction v â€” w as v + (â€”w), where â€”w is the additive inverse of w, with the same magnitude as w and pointing in the opposite direction. Represent vector subtraction graphically by connecting the tips in the appropriate order, and perform vector subtraction component-wise.', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSN-VM.4c', 'N-VM.4c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114365A";s:2:"id";s:8:"S114365A";s:6:"parent";s:8:"S1143621";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"N-VM.4.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"B5969B9BA727452CAB1EF05C4694974C";s:11:"dotNotation";s:14:"Math.HSN-VM.4c";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSN/VM/4/c";s:10:"currentURL";N;}'),
(470, '5B4228464AF24FC2A8B23CF733ABD5D8', 'Math', 'English', '(+) Multiply a vector by a scalar.', 5, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSN-VM.5', 'N-VM.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143622";s:2:"id";s:8:"S1143622";s:6:"parent";s:8:"S114359D";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"N-VM.5";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"5B4228464AF24FC2A8B23CF733ABD5D8";s:11:"dotNotation";s:13:"Math.HSN-VM.5";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSN/VM/5";s:10:"currentURL";s:114:"http://www.corestandards.org/the-standards/mathematics/hs-number-and-quantity/vector-and-matrix-quantities/#n-vm-5";}'),
(471, 'FA032D8A02564B37A0BAF505A0296FB5', 'Math', 'English', 'Represent scalar multiplication graphically by scaling vectors and possibly reversing their direction; perform scalar multiplication component-wise, e.g., as c(v&lt;sub&gt;x&lt;/sub&gt;, v&lt;sub&gt;y&lt;/sub&gt;) = (cv&lt;sub&gt;x&lt;/sub&gt;, cv&lt;sub&gt;y&lt;/sub&gt;).', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSN-VM.5a', 'N-VM.5a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114365B";s:2:"id";s:8:"S114365B";s:6:"parent";s:8:"S1143622";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"N-VM.5.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"FA032D8A02564B37A0BAF505A0296FB5";s:11:"dotNotation";s:14:"Math.HSN-VM.5a";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSN/VM/5/a";s:10:"currentURL";N;}'),
(472, 'FA032D8A02564B37A0BAF505A0296FB4', 'Math', 'English', 'Compute the magnitude of a scalar multiple cv using ||cv|| = |c|v. Compute the direction of cv knowing that when |c|v ? 0, the direction of cv is either along v (for c &gt; 0) or against v (for c &lt; 0).', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSN-VM.5b', 'N-VM.5b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114365C";s:2:"id";s:8:"S114365C";s:6:"parent";s:8:"S1143622";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"N-VM.5.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"FA032D8A02564B37A0BAF505A0296FB4";s:11:"dotNotation";s:14:"Math.HSN-VM.5b";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSN/VM/5/b";s:10:"currentURL";N;}'),
