(527, '916EED53C7DB4D2D8BD6ACB4E277B714', 'Math', 'English', '10. Understand that the graph of an equation in two variables is the set of all its solutions plotted in the coordinate plane, often forming a curve (which could be a line).', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSA-REI.10', 'A-REI.10', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143642";s:2:"id";s:8:"S1143642";s:6:"parent";s:8:"S1143595";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"A-REI.10";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"916EED53C7DB4D2D8BD6ACB4E277B714";s:11:"dotNotation";s:15:"Math.HSA-REI.10";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSA/REI/10";s:10:"currentURL";s:126:"http://www.corestandards.org/the-standards/mathematics/high-school-algebra/reasoning-with-equations-and-inequalities/#a-rei-10";}'),
(528, 'FBFBA64C70074AC99425390F527D0A85', 'Math', 'English', '11. Explain why the x-coordinates of the points where the graphs of the equations y = f(x) and y = g(x) intersect are the solutions of the equation f(x) = g(x); find the solutions approximately, e.g., using technology to graph the functions, make tables of values, or find successive approximations. Include cases where f(x) and/or g(x) are linear, polynomial, rational, absolute value, exponential, and logarithmic functions.&lt;sup&gt;â˜…&lt;/sup&gt;', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSA-REI.11', 'A-REI.11', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143643";s:2:"id";s:8:"S1143643";s:6:"parent";s:8:"S1143595";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"A-REI.11";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"FBFBA64C70074AC99425390F527D0A85";s:11:"dotNotation";s:15:"Math.HSA-REI.11";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSA/REI/11";s:10:"currentURL";s:126:"http://www.corestandards.org/the-standards/mathematics/high-school-algebra/reasoning-with-equations-and-inequalities/#a-rei-11";}'),
(529, '37C6331417654D34A416EE557CE4430E', 'Math', 'English', '12. Graph the solutions to a linear inequality in two variables as a half-plane (excluding the boundary in the case of a strict inequality), and graph the solution set to a system of linear inequalities in two variables as the intersection of the corresponding half-planes.', 0, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSA-REI.12', 'A-REI.12', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143644";s:2:"id";s:8:"S1143644";s:6:"parent";s:8:"S1143595";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"A-REI.12";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"37C6331417654D34A416EE557CE4430E";s:11:"dotNotation";s:15:"Math.HSA-REI.12";s:3:"URI";s:53:"http://corestandards.org/2010/math/content/HSA/REI/12";s:10:"currentURL";s:126:"http://www.corestandards.org/the-standards/mathematics/high-school-algebra/reasoning-with-equations-and-inequalities/#a-rei-12";}'),
